import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.css";
import "../index.css";

class NavBar extends Component {
  state = {};
  render() {
    return (
        <nav className="navbar navbar-expand-lg navbar-light bg-light fixed-top">
          <span className="navbar-brand mb-0 h1">Navbar</span>
          <form className="form-inline my-2 my-lg-0">
            <input type="search" className="form-control mr-sm-0" />
            <span>
              <button className="btn btn-primary mr-sm-0">Search</button>
            </span>
          </form>
		  <button className="navbar-toggler" type='button' data-toggle='collapse' data-taget = '#navbarcontent' aria-controls='navbarcontent' aria-expanded='false' aria-label='Toggle navigation'>
			  <span className="navbar-toggler-icon"></span>
		  </button>
		  <div className="collapse navbar-collapse" id='navbarcontent'>
			  <ul className="navbar-nav mr-auto mt-2 mt-lg-0">
				  <li className="nav-item active">
					  <a href="#" className="nav-link">Home <span className="sr-only">(Current)</span> </a>
 				  </li>
			  </ul>
		  </div>
        </nav>
    );
  }
}

export default NavBar;
